        public static BLF_ImageResults CreateTransformedImages(Image baseImage)
        {
            //Check our dimensions.
            if (baseImage.Size.Width != 463 && baseImage.Size.Height != 152)
            {
                //If they are invalid, throw an exception.
                throw new Exception("The given base bitmap image did not have the appropriate dimensions(463x152).");
            }
            //Initialize our BLF_ImageResults
            BLF_ImageResults BLF_Images = new BLF_ImageResults();
            //Set our base bitmap
            BLF_Images.BaseBitmap = baseImage;
            //Set our sm bitmap
            BLF_Images.SmBitmap = baseImage;
            //Create our film image
            BLF_Images.FilmBitmap = CreateFilmImage(baseImage);
            //Create our clip image
            BLF_Images.ClipBitmap = CreateClipImage(BLF_Images.FilmBitmap);
            //Create our variant image
            BLF_Images.VariantBitmap = CreateVariantImage(baseImage);
            return BLF_Images;
        }
        private static Image CreateFilmImage(Image image)
        {
            //Resize our image.
            Image result = ResizeBitmap(image, 363, 119);
            //Cut 50 off the width to get the middle of the image
            result = TrimWidth(result, 85);
            //Paste it in the middle to create our border
            result = CreateFilmBorder(result);
            //Return our result
            return result;
        }
        private static Image ResizeBitmap(Image b, int nWidth, int nHeight)
        {
            Bitmap result = new Bitmap(nWidth, nHeight);
            using (Graphics g = Graphics.FromImage((Image)result))
                g.DrawImage((Bitmap)b, 0, 0, nWidth, nHeight);
            return (Image)result;
        }
        private static Image CreateFilmBorder(Image image)
        {
            Bitmap result = new Bitmap(256, 141);
            using (Graphics g = Graphics.FromImage((Image)result))
                g.DrawImage((Bitmap)image, 31, 11);
            return (Image)result;
        }
        private static Image TrimWidth(Image image, int widthTrimAmount)
        {
            //Initialize our resultant bitmap
            Bitmap result = new Bitmap(image.Width - (widthTrimAmount * 2), image.Height);
            //Create a bitmap for our original image
            Bitmap orig = (Bitmap)image;
            //Loop through the width(excluding the trimmed)
            for (int i = widthTrimAmount; i < (image.Width - widthTrimAmount) -1; i++)
            {
                //Loop through the height
                for (int z = 0; z < image.Height; z++)
                {
                    //Set the pixel
                    result.SetPixel(i - widthTrimAmount, z, orig.GetPixel(i, z));
                }
            }
            //Return our result
            return (Image)result;
        }
        private static Image CreateClipImage(Image filmImage)
