            //Loop through the width(excluding the trimmed)
            for (int i = 0; i < filmImage.Width; i++)
            {
                //Loop through the height
                for (int z = 0; z < filmImage.Height; z++)
                {
                    if (i >= 30 && i <= 72 && z >= 68 && z <= 130)
                    {

                    }
                    else
                    {
                        //Set the pixel
                        result.SetPixel(i, z, orig.GetPixel(i, z));
                    }
                }
            }
            //Return our result
            return (Image)result;
        }
